const train = `这是我刚刚进入到公司一段时间之后记录的，我因为刚刚进入公司所以对公司的业务以及我要去做的一些事情都不是了解，在一开始的时候我们部门的主管会指引我到属于的工作区域、带领我熟悉一下工作环境、告诉我以后工作跟随的上司是谁等等这些琐事。之后我大致知道自己的工作职责是什么，因为我的职位是自媒体运营实习，我的主要职责是负责公司自媒体平台的日常运营、配合团队完成用户的整体增长目标、负责公司公众号、微博、头条、抖音、小红书、官方网站等平台内容的撰写并完成发布工作等等有关自媒体、网络的任务。并且我还要帮助我的上司去完成一些视频剪辑、美工、协助拍摄的任务。以上就是我刚进入公司实习，通过前几天的学习所得到的收获，因为还没有熟悉公司业务所以业务做的比较少，更多的还是熟悉工作环境和工作职能。
 
<|Split|>

​这段时间我跟随我的上司在做一个微信上公众号的制作，具体内容是要制作一个关于上海美食节的自媒体公众号来提高我们企业的传播力。我们要到上海实地去拍摄，其他部门已经为我们找到了我们需要使用的模特，然后我跟着我的上司前往上海实地。到达目的地之后我主要是协助我的上司完成一些琐事，例如调整拍摄角度、查看连续拍摄两张图片的差异等等。这是我第一次去做的一个自媒体项目，我觉得我的收获还是蛮大的，我了解到了企业里去制作一个自媒体发布需要完成的流程和操作，虽然我只是处理的是一些协助的工作但是我能够一起参与这个小项目的制作中。最后拍摄完毕之后就回公司做一些拍摄完毕图片的处理工作，这些可能会是下一阶段要处理的任务，暂时我的上司还没有委派任务给我。
 
<|Split|>

​紧接着上一次微信上公众号的制作，我和我的上司已经完成了拍摄的任务，然后就是要处理拍摄出来的图片。我被委派了处理图片，需要使用到Photoshop对图片做一些色调、光线、背景等等的处理，在我使用过程中碰到了不少的问题，感觉和我之前在校使用Photoshop有很大的差异，我需要了解到更多有关Photoshop的使用操作才能够轻松地完成这个任务。在我有困难的时候我会直接问我的上司，请教问题的处理方式，最终都是顺利解决了问题，在我处理过程中我也需要和美工沟通，有些时候需要用到一些我们公司的logo或者是一些其他的图案来做水印，这就需要找美工要水印的图然后我把图放到处理的图片上。我这次任务给我的感悟是我学的东西还是太少了，一开始接到这个任务的时候我感觉自己有点手忙脚乱，主要原因就是对Photoshop的使用不够熟练。
 
<|Split|>

​还是接着上一次微信上公众号的制作的任务，在我完成了对拍摄的图片进行修改之后，需要做的就是完成文案的编写。所幸我们公司有文案部门，不用我们运营去撰写文案，于是我只要和负责这个微信公众号项目的文案人员沟通就能够完成文案的编辑。在我执行这一任务过程中同样也会遇到很多我想不到的问题，我辗转于文案部和我们运营部，将我们的需求即刻告诉文案人员，也要把我处理不了的文案人员的问题即刻告诉我的上司来决策。在经过了一番捣腾之后完成了对文案的编写，接着就是要进行排版然后发布了，排版的过程中我没有参与但是也目睹了整个排版的过程，排版是可以找到美工一起协助的，因为在排版过程中可能会用到一些边框装饰物或者是图片，然后就是不断地进行排版对比，选择出最好的排版。
 
<|Split|>

​微信上的公众号任务接近尾声了，完成了拍摄、图片处理、文案的编写以及排版之后，我们就要处理发布了，但如何去发布公众号不是我们的事情，是IT部门程序员的职责。我们只要将我们的设计稿放到蓝湖中就可以了，然后程序员就会按照我们所制作的设计稿来完成公众号的发布。在这一过程中我们也需要随时地和程序员对接文案数据和图片数据，也要监视程序员所制作出来的样式和我们的设计样式是否有冲突。我感觉在这一过程中还是比较轻松的，因为不用去做一些自己的工作，只需要口头上交流就可以，在我工作了这么些日子来看，我的收获还是蛮大的。我的第一个任务就是去协助完成一个微信的公众号，对于我来说任务量确实有点大，但是我的成长也很快，我在接下来的工作应该更加努力地去学习和做业务。
 
<|Split|>

​这段时间主要是做一些已经完成的项目的修改和维护，没有什么大的任务需要我去协助。总结一下现阶段所完成的任务，首先是处理公众号、头条、微博上我们企业号发布的文章评论做一个统计和排查黑粉，需要将哪些黑我们企业的评论都找到然后删除并记录数量在案，然后对评论统一看一遍，把真正对我们企业有用的意见和想法找出来记录并汇报。其次是对于我们企业发布的一些文案做出修改，有时候这些修改是文字内容的修改，有时候修改只是对一些文字使用不妥当的修改。然后就是去各个平台上查看统计我们企业产品号的粉丝和反馈，并且与我们的粉丝进行互动，回答一些粉丝提出的问题。这段时间虽然没有什么大任务，但让我更加熟悉了企业工作任务的内容，还是有一定的收获的。
 
<|Split|>

​因为疫情的原因，我这段时间有几天是在家办公的，这段时间的任务是协助完成一个抖音号的运营，这个抖音号是我们企业想要在抖音上提高自身传播力度而展开的，具体在这个抖音号中会结合发视频和举行直播来运营。我的职责是协助视频的完成以及在直播中充当管理员的工作。首先协助视频依旧主要是完成后期的图片修改和文案的协助工作，但这次修改的不是图片而是视频，使用的工具也不是Photoshop而是pr，因为我之前使用pr比较少所以熟练度就比较差，我结合网络上的教学处理了视频剪辑和修改还算是成功地完成了任务。然后是在直播中协助管理，这就需要我在企业产品号直播的时候一同进入观看，随时观着观看者的评论，提取那些有意见性的评论从而记录，把那些带有辱骂侵犯的评论者屏蔽掉。
 
<|Split|>

​我已经在这家企业里工作了有一段时间了，通过这些时间的实习工作我了解到真正在企业工作是不易的，这阶段我的任务是在各个自媒体平台寻找对我们企业产品的突破口，我认为这个任务对我来说是比较难的。因为我们企业的新产品是一款社交类型的产品，我们运营部需要先对这款产品的定位以及创新点做出调整，为的是能够打造一款更加好的产品。由此我就需要在各自媒体平台中寻找亮点，把这些可以引用的创新点做一个统计然后总结出规律、可以改善的点，最后汇报给我的上司。这不同于我之前做的业务任务，这次的任务考验的更多的是工作经验和沉淀，对于我这样的职场小白来说想要找到一些突破口还是很难的，虽然最终我把我自己的想法和统计汇报上去了，但我仍然感觉自己缺乏的经验和能力是较多的，需要自己去沉淀经验。
 
<|Split|>

​近期任务和以往的任务差不多，我总结一下我的工作职责，我现在的实习工作是自媒体运营实习，在我经过这段时间的实习之后我大致了解到了自己的工作职能。在我的工作中需要去制作一些企业要求的自媒体产品，自媒体产品是包括了拍摄、图片或者视频的处理、文案的编写、设计排版、与工程师沟通上线等等几方面来制作。这些任务在我经过比较长时间的学习之后都有过接触，然后也通过实际工作提高了自己的专业技能。同时我也需要去跟进一些企业已经完成的自媒体项目，对这些项目需要处理一些新的需求和维护任务，此类任务较为简单我都能顺利地完成。除此之外还需要完成已经在运营的项目的统计信息和监管的任务，例如去统计粉丝数量、粉丝评论之类的然后总结并提出自己的一些建设性意见，这些需要我通过工作时间来累计经验。

<|Split|>

​这是最后一次的实习记录，近段时间要做的业务也不算很多，主要需要我做的业务还是对已有自媒体项目的修改以及跟进协作一些新项目。已经在企业中工作了一段时间，我对于企业中的业务和企业对我能力的要求、职责的要求都基本了解并且熟悉了，我的感悟是真实到企业中工作和在学校中完成一些学校作业是大有不同的，在学校里有老师、同学会帮助我，但是到企业中更多地还是依靠自己上网查阅解决方式。企业布置给我的任务对我来说都是新知识，是我之前没有接触过的，所以我感觉这次的实习经历对我来说帮助很大，让我学到了很多新知识，对我以后真正的职场帮助是很大的，我也需要更多地课余时间对我技能的学习，以便在以后的工作中能更好地发挥出我的能力，提高自我的职场竞争力。`

